ウルトラパワーズ 洗たく槽クリーナー 550g<br>ブランド：ウルトラパワーズ<br>販売・製造元：エステー<br><br>カビや菌を除去し、気になるカビ臭をスッキリ消臭する洗濯槽クリーナーです。<br>洗たく槽裏側の汚れにすばやく浸透するつけおきいらずの液体タイプです。<br>再付着防止剤配合により、はがれたカビが洗濯槽に付きにくくなっています。<br>くずとりネットもしっかり除菌します。<br> <br>液性アルカリ性 用途洗濯槽の洗浄(ステンレス槽・プラスチック槽どちらにもご使用できます)全自動、乾燥機能付き全自動、ドラム式、ななめドラム式、二槽式(脱水槽にも使えます) <br><br>使用方法<br>■使用量の目安4-9kgサイズの洗濯機：全量(550g)/1回使いきりタイプ■ワンポイントアドバイス・初めてご使用や汚れがひどい場合は、6時間つけ置きすると効果的です。<br>・1-2ヵ月ごとの定期的なご使用が効果的です。<br>■<br><br>使用方法<br>※機種によって<br><br>使用方法<br>が異なる場合があるので、お使いの洗濯機の取り扱い説明書を参照する。<br>(A)全自動洗濯機の場合(乾燥機能付きも同様)(B)ドラム式洗濯機の場合(ななめドラム式も同様) 1. 電源を入れてから薬剤全量を洗たく槽に入れる。<br> 2. 高水位まで吸水する。<br> 3. そのまま「標準コース*1」で1サイクル(洗い*2→すすぎ→脱水)運転する。<br> *1 「槽洗浄コース」での使用も可。<br> *2 粗い時間が設定できる場合は、3分に設定して使用も可。<br>(C)二層式洗濯機の場合 ※洗たく槽、脱水槽のいずれか1回分の洗浄ができます。<br>洗濯槽は(A)の方法と同様。<br>ただし、脱水層に使用する場合は槽全体に薬剤全量をまんべんなくかけ、約1時間放置する。<br>その後水で充分に洗い流す(充分に洗い流さず洗濯物を入れると漂白されることがある)。<br>※薬剤は飛びはねる可能性があるのでゆっくり入れる。<br>※入浴剤を使用した風呂の残り湯は使用しない。<br>※衣類を入れない。<br>※汚れがひどい場合は1回の洗浄では取りきれないことがあります。<br> <br><br>使用上の注意<br>●幼児の手の届く所には置かない。<br>●用途以外には使用しない。<br>●体調がすぐれない時は使用しない。<br>●必ず単独で使用する。<br>●酸性タイプの製品と混ぜると有毒なガスが発生して危険。<br>●他の容器に移して使用しない。<br>●熱湯では使用しない。<br>●使用時はゴム製等の手袋を着用する。<br>●容器を強く持ってキャップを開けると薬液が飛び出る恐れがあるので注意する。<br>●使用時は必ず充分に換気する。<br>●使用時に液が目に入らないように注意する。<br>●衣類等に付着すると脱色する恐れがあるので注意する。<br>●直射日光のあたる所、高温の所、火気の近くには置かない。<br>●洗たく槽以外に誤ってかけた場合は速やかに拭き取り、よく水拭きする。<br> ご注意<br>●酸性タイプの製品と一緒に使う(まぜる)と有害な塩素ガスが出て危険。<br>●液が目に入ったら、すぐに水で洗う。<br>●子供の手にふれないようにする。<br>●必ず換気をよくして使用する。<br> 応急処置●使用中に目にしみたり、せきこんだり、気分が悪くなった時は使用をやめてその場から離れ、洗顔・うがい等をする。<br>●目に入った時は目を傷める恐れがあるので15分以上流水でよく洗う。<br>必ず直後に眼科医に相談する。<br>そのまま放置すると失明の恐れがある。<br>●飲み込んだ時は履かせずにすぐに口をすすぎ、コップ1-2杯の水か牛乳を飲ませる。<br>●皮膚についた時は流水でヌメリ感がなくなるまで洗い流す。<br>●いずれの場合も速やかに医師に相談する。<br> <br>成分<br>次亜塩素酸塩、水酸化ナトリウム(0.5%)、再付着防止剤、界面活性剤(アルキルアミンオキシド)、安定化剤<br> 原産国日本 <br><br>お問い合わせ先<br>エステー株式会社 お客様相談室TEL：03-3367-2120 <br>日用品／洗濯用品／洗濯機用品／洗濯槽クリーナー<br>JANコード： 4901070909032<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
